INSERT INTO "Location" ("latitude", "longitude")
SELECT 
    41.0 + RANDOM() * (51.5 - 41.0),   -- Latitude entre 41.0 et 51.5
    -5.0 + RANDOM() * (9.5 - (-5.0))   -- Longitude entre -5.0 et 9.5
FROM generate_series(1, 1000);